import React from 'react';

const AccountDetails = ({ showAccountDetails, setShowAccountDetails }) => {
  return (
    <div
      className='modal'
      tabIndex='-1'
      role='dialog'
      style={{
        display: showAccountDetails ? 'block' : 'none',
        color: 'black',
      }}
    >
      <div className='modal-dialog' role='document'>
        <div className='modal-content  glassmorphism'>
          <div
            type='button'
            className='close guest-modal'
            onClick={() => setShowAccountDetails(false)}
          >
            <span aria-hidden='true'>&times;</span>
          </div>

          <div className='modal-body'>
            <div
              style={{
                color: 'white',
                display: 'flex',
                flexDirection: 'column',
              }}
            >
              <div
                style={{
                  textAlign: 'center',
                  marginBottom: '10px',
                  fontWeight: 700,
                }}
              >
                Cash Gift
              </div>
              <span>Account Details:</span>
              <span>Bank: Wema Bank</span>
              <span>Name: Adewale AkinlagunÂ </span>
              <span>Account Number: 0233584142</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AccountDetails;
